(1, 'Tomb Raider', 'ทูม เรเดอร์', 2018, , 1, 'ลาร่า ครอฟท์ คือลูกสาวผู้รักในอิสระอย่างแรงกล้าของนักแสวงโชคผู้สาปสูญไปในตอนที่เธอยังเป็นเพียงวัยรุ่น และตอนนี้หญิงสาววัย 21 ผู้ไร้ซึ่งเป้าหมายหรือความฝันในชีวิต ลาร่า ได้สังเกตเห็นความวุ่นวายที่ถนนสายหนึ่งในย่านแฟชั่นของลอนดอนตะวันออก<br/><br/>ในฐานะเด็กส่งของผู้มีชีวิตอย่างยากลำบาก ไม่ว่าจะเป็นการกู้สินเชื่อ การเข้าเรียนมหาวิทยาลัย และเข้าเรียนให้ทันเวลาได้น้อยครั้ง เธอตัดสินใจจะสร้างเส้นทางชีวิตของตนเอง หญิงสาวปฏิเสธการเข้ารับตำแหน่งประจำสหราชอาณาจักรต่อจากพ่อเธอ เพียงเพื่อเป็นการยืนกรานในความคิดของตนเองว่าพ่อของเธอยังไม่จากไปไหน แม้ว่าจะได้รับคำแนะนำให้ยอมรับความเป็นจริง ที่ว่าเธอต้องยืนหยัดด้วยขาของตนเองมาตลอดเจ็ดปีโดยไม่มีพ่อก็ตาม และแม้แต่เจ้าตัวก็ยังไม่เข้าใจ ว่าอะไรทำให้เธอตัดสินใจที่จะไขปริศนาการตายของพ่อได้<br/><br/>เพื่อรับรู้ความปรารถนาสุดท้ายของพ่อ เธอตัดสินใจละทิ้งทุกสิ่งที่เธอมีไว้ด้านหลัง และเริ่มค้นหาเป้าจุดมุ่งหมายสุดท้ายของพ่อเธอ: สุสานในนิทาน ที่อยู่บนเกาะลึกลับที่ไหนสักแห่งแถวชายฝั่งประเทศญี่ปุ่น แต่ภารกิจของเธอไม่ง่ายถึงเพียงนั้น แค่การไปถึงเกาะก็เต็มไปด้วยการทรยศหลอกลวง และทันใดนั้น เธอก็เสี่ยงจนถึงขีดสุด เมื่อต้องรับมือกับภยันตรายและอาวุธต่างๆอย่างยากลำบาก ด้วยเพียงจิตใจอันแข็งแกร่ง โชคชะตาอันมืดบอด และจิตวิญญาณอันไม่ยอมแพ้เท่านั้น เธอต้องเรียนรู้ที่จะผลักดันตัวเองไปให้มากกว่าขีดจำกัด เมื่อการเดินทางในครั้งนี้ นำพาไปสู่การผจญภัยอันเหลือเชื่อ ที่นำพาชื่อ \"\"ทูม เรเดอร์\"\" มาให้เธอนั่นเอง', 'โรอา อูธาก', 'อลิเซีย ไวกันเดอร์, ฮันนา จอห์น-คาเมน, วัลตัน ก๊อกกิ๊นส์ ', 'แอ็คชัน / ผจญภัย', 'น 13+', 119, '08 มีนาคม 2018 ');
