INSERT INTO `reviews` (`id`, `pageid`, `movieid`, `score`, `rshort`, `rlong`, `date`) VALUES
(1, 1, 1, 80, 'วิกันเดอร์สุดยอด', 'Tomb Raider อลิเซีย วิกันเดอร์ คือลาร่า ครอฟท์ ที่เยี่ยมมากกก โคตรเริ่ด หนังก็สนุกมากกกกกกกเอาไปเลย 8/10\r\n.\r\nแบบว่าอยาก กรี๊ดดดๆๆๆๆๆๆๆๆๆกับ วิกันเดอร์ นางทำได้เรารักนาง เรารักนางมากกกกตั้งแต่ Ex machina แล้วมาตกหลุมรักแบบตายห่าไปเลยตอนนางแสดง Danish Girl ชอบหน้าของวิกันเดอร์มากกกกกถึงมากที่สุด ผมว่าวิกันเดอร์เป็นดาราหญิงที่หน้าโคตรสวยเลย แล้วตัวเล็กมากกกกกก ดูแบบผอมเกร็งแบบคนออกกำลังกาย หุ่นเฟิร์ม เป็นชะนีหุ่นในฝันของชะนีทั่วโลกเลย ดูให้บอบบางก็น่าทนุถนอม แต่ใน Tomb Raider นี่คือแกร่งมากกก อินเนอร์ก็แรง และเป็นภาพจำใหม่ของลาร่า ครอฟท์ ที่บารมีไม่แพ้โจลี่สมัยเมื่อสิบกว่าปีก่อนได้สบาย ใน่วนของตัวหนังนี่พูดเลย ผมชอบหนังผจญภัยแนวอินเดียน่าโจนส์อยู่แล้ว พอได้ดูเลยโคตรฟิน \r\n.\r\nTomb Raider เวอร์ชั่นปี2018 นี่เป็นการรีบูทใหม่ แบบเริ่มต้นล้างไพ่ใหม่หมดเลย ไม่ต้องเคยดู ไม่ต้องไปศึกษาเกมส์อะไรมาก่อนก็ได้ แนะนำให้มาเริ่มต้นด้วยจักรวาลในหนังไปเลย ลาร่า คราฟท์ คือลูกสาวของเศรษฐีนักสำรวจที่ไม่ยอมเซ็นต์เอกสารยอมรับว่าพ่อที่หายสาบสูญไปกว่า 7 ปีได้ตายไปเลย เธอเลยไม่ได้สนใจทรัพย์สมบัติอะไร หาเลี้ยงตัวเองด้วยการต่อยมวยและขี่จักรยานส่งของ แต่ชะตากรรมก็ทำให้เธอไม่สามารถหนีพ้นการเป็นคุณหนูทายาทหมื่นล้านได้ ทันทีที่เธอกลับเข้าคฤหาสน์พ่อ เธอก็ได้พบคลิปวิดีโอที่พ่อสั่งเสียไว้ว่าให้เผาเอกสารฮิมิโกะโปรเจคของพ่อให้หมด แน่นอนเธอจะยอมเผาเหรอ ในเมื่อมันเป็นเบาะแสสุดท้ายที่เธอจะได้ไปเจอพ่อ เธอเลยออกเดินทางไปฮ่องกงเพื่อไปหาลูเรน (เดเนียล วู หล่อมากกกกกกกกกกกกกก) กลาสีเรือเพื่อให้พาไปค้นเกาะยามาไท เพื่อที่จะได้ไปเจอกับสุสานของจักรพรรดินีฮิมิโกะ ที่พ่อของเธอหายสาบสูญไปที่นั่น เธอจะต้องไปเจอกับอะไรกันแน่ และแน่นอน ลาร่า ครอฟท์ยังไงก็ต้องตะลุยสุสานแน่นอน\r\n.\r\nพูดถึงตัวหนังก่อนเลย ด้วยความที่ Tomb Raider มันเป็นหนังผจญภัยสุสานของนางเอก ลาร่า ครอฟท์ เจ้าของฉายาอีสาวตะลุยสุสาน หนังมันก็เลยพาเราไปพบกับอารยธรรมโบราณที่เต็มไปด้วยปริศนา ค่ายกล ไปจนถึงพวดสารพัดโลง สารพัดศพโบราณ ซึ่งค่ายกล CG ในหนังนี่คือทำออกมาได้อลังการณ์และใช้ CG ก็ดี ตัวนางเอก ลาร่า ครอฟท์ ที่อลิเซีย วิกันเดอร์ แสดงที่พูดเลยว่า ชนะเลิศมากกก วิกันเดอร์ เป็นลาร่า ครอฟท์ ได้ดีกว่าที่ผมคาดหวังเอาไว้อีก คือเรื่องฝีมือทางกานแสดงเนี่ยไม่ห่วงเลย ห่วงว่าจะสวยบอบบางเกินไป แต่ในเรื่องนี่คือ สวยและบอบบางจริง แต่หุ่นเฟิร์มมากกก นมไม่ใหญ่เกินไปนะ กำลังดี แบบหุ่นโคตรสวย และหน้าเฟียสแบบเฟียสมากกกกกก สารภาพเลย ตอนสมัยดูของ โจลี่ นั่นผมไม่ค่อยอินเท่าไหร่เลย นางนมโตไป แต่วิกันเดอร์นี่นมไม่ได้ใหญ่เวอร์ แต่ชอบงานหน้า งานผิว ผิวนางสีสวยมากกกกก ผิวสวยแบบอเมริกันผู้ดีแบบคนรวย คือผิวแทน โอ้ยยยย เป็นผู้หญิงที่หน้าสวยแบบดูไม่เบื่อเลย เดเนียลวูนี่ก็งานดี๊ดี หน้าหล่อ หุ่นดี แล้วตัวร้ายในเรื่องนี้ก็หน้าโฉดดี แบบดูยังไงก็เชี่ย\r\n.\r\nงานคอสตูม งานโชว์คฤหาสน์ สังคมลาร่า ไปจนถึงเปิดตัวอันนา พี่เลี้ยงลาร่าที่มาดูแลทรัพย์สมบัติแทนที่รับบทโดย คริส ติน สก็อต โทมัส นี่พูดเลย บทนางน่าสนใจมากกกก\r\n.\r\nฉากบู๊ ฉากวินาศสันตะโร ถล่มสุสาน วิ่งหนีแผ่นดินแยก วิ่งหนีสุสานพัง วิ่งหนีกับดักค่ายกลนี่อยากเอานาฬิกาแอปเปิ้ลไปติดข้อมือลาร่า ครอฟท์มากกกกว่านางวิ่งในเรื่องนี้ทั้งหมดไปกี่กิโล คือนางวิ่งจริงๆ วิ่งทั้งเรื่อง วิ่งจนเหนื่อยแทน\r\n.\r\nความสนุกของหนังคือหนังแม่งสนุกแบบสนุกมากกกกกกกก แบบไม่ต้องไปนั่งลุ้นในโรงเลยว่าหนังจะมีช่วงไม่สนุกมีช่วงเนือยไหม พูดเลยพอมีบ้าง แต่ภาพรวมคือสนุก ใครชอบหนังผจญภัยแนวสำรวจสุสานแบบอินเดียน่าโจนส์นี่ไปดูเลย ไม่เสียดายตัง ส่วนตัวให้ 8/10 เสียดายว่าอยากให้สนุกกว่านี้อีก แต่มันขนาดนี้ก็โอเคล่ะ ไม่รู้จะบอกไรนอกจาก รอภาคสองละกัน', '1 มกราคม 2560'),
(2, 1, 2, 60, 'หนังน่าเบื่อมากจนเกือบหลับ เจนลอว์สวยฟาดยั่วยวนมาก', 'Red Sparrow หนังนิ่งมากกกกก มีความเนือยและหนืดสูง เจนลอว์ช่วยหนังเอาไว้แท้ๆ 6/10\r\n(ฝากติดดาว ติดตามเพจด้วยนะคร้าบ)\r\n.\r\nต้องขอบอกเลยว่าผมเป็นคนนึงที่ไม่ค่อยชอบดูเทรลเลอร์หนัง และไม่มีเวลาตามข่าวหนังเลย จนรู้ว่า Red Sparrow คือหนังใหม่ของเจนลอว์ กำกับโดย Francis Lawrence ที่ทำตระกูล Mockingjay มา ใจนึงก็คิดว่าหนังคงมาตราฐานระดับนึง แต่อีกใจก็แบบเอออีตระกูลม็อกกิ้งเจย์นี่ก็ไม่ค่อยรอดนะ Francis Lawrence เป็นคนเล่าเรื่องน่าเบื่อ แต่เห็นตัวอย่างแล้วก็แบบ เออ น่าดูว่ะ เจนลอว์นี่ยิ่งเป็นสาวยิ่งสะพรั่ง อะล้าอร่าม หนังคงสไตล์สายลับเอามาฝึกๆให้เป็นเครื่องจักรฆ่าคนอะไรทำนองนั้น แต่พอดูเข้าจริงๆ ความรู้สึกคือเหมือนเอาแกงจืดเย็นๆชืดๆมาให้ตักน้ำแกงซดกินไปเรื่อยๆ หนังนิ่งมากและน่าเบื่อมากกกก คือผมน่ะไม่หลับนะแม้แต่งีบเดียว แต่หาวแล้วหาวอีก\r\n.\r\nเนื้อหาของหนังก็พูดถึงนางเอก โดมินิกา เป็นนางเอกบัลเลท์บอลชอย ที่ต้องดูแลแม่ที่ป่วย ทีนี้อยู่มาวันนึงนางได้รับอุบัติเหตุทำให้ขาของเธอไม่สามารถเล่นบัลเล่ได้อีกต่อไป แต่ภาระหนี้สินที่ต้องรับผิดชอบก็ยังมี อาแท้ๆเลยจ้างวานให้เธอไปเป็นนางนกต่อนอนกับผู้ชายคนนึงที่เป็นศัตรูของรัสเซีย แต่ปรากฏว่ามีคนเข้ามาฆ่าผู้ชายคนนั้น โดมินิกาเดือดร้อน ต้องเลือกระหว่างโดนอีกฝ่ายตามเก็บหรือเข้าเรียนโรงเรียนสายลับของรัสเซีย ซึ่งมีเป้าหมายให้เธอกลับออกมาติดตาม เนท ชายชาวอเมริกาที่เป็นผู้ติดต่อกับคนรัสเซียที่ทรยศชาติเป็นคนสุดท้่ายก่อนตาย เนื้อหาประมาณนี้แหละ รับรองว่าไม่ได้เล่าเกินเลยจากตัวอย่างเลยแม้แต่น้อย \r\n.\r\nคืออยากจะบอกว่าปกติหนังสปาย หนังสายลับสองหน้าเนี่ย คนเล่าเรื่องมันต้องโคตรเซียน โคตรเก่ง คนดูถึงตามดูได้ไม่งง สำหรับเรื่องนี้ตามดูจริงๆปมหนังไม่ซับซ้อนเท่าเรื่องอื่นๆ ตัวดีตัวร้ายแทบจะเปิดหน้าแบไต๋ให้รู้กันตั้งแต่ยังไม่กลางเรื่องแล้ว แต่หนังมันเดินเรื่องได้เนือยมากน่าเบื่อ ดนตรีประกอบก็เลือกมาใช้ได้แบบเรื่อยเอื่อย ในขณะที่หนังต้องการความเร้าใจหน่อยๆ ดนตรีประกอบก็ยังตุมโทนโมโนโทน แต่ตอนจบนี่ดนตรีประกอบนี่ขจะแผดเสียงกระหึ่มยังกะซ่องแตก ส่วนอีโรงเรียนฝึกสายลับของเซนเซชะนีที่ได้ Charlotte Rampling มาแสดง ใครนึกไม่ออกให้ไปดูซีรีส์ English Spy หรือไม่ก็ไปดูหนัง 45 Years ที่นางรับบทเป็นคุณยายผู้ร้าวรานนั่นแหละ เรื่องนี้นางมาแบบเซนเซรัดเกล้าเลยจ้า นางทำให้โรงเรียนสอนสายลับดูกลายเป็นโรงเรียนสอนกะหรี่ นักเรียนทุกคนต้องห้าวHee ต้องรู้จัดอ่อนของฝ่ายต้องข้ามว่าต้องการอะไร ซึ่งเหมือนโรงเรียนแม่งเน้นอย่างเดียวว่าฝ่ายตรงข้ามแม่งต้องการที่จะเฮ้ด เฮ็ด แล้วก็เฮ็ด ในโรงเรียนแม่งสอนทั้งอมกะดอ สอนทั้งวิชาแหกHeeหน้าห้องให้ผู้ชายมาเฮ็ดโชว์ อีป้าเซ็นเซนี่หน้าตาโรคจิตแบบร่านราคะมากกกกก ลุ้นแค่ตอนจบนางจะออกมาบอกว่า โดมินิก้า เธอทำสำเร็จแล้ว เธอเก่งที่สุด เธอเก่งมาก เฮ้ดมัน เฮ็ดมัน เฮ็ดมัน เธอคือลูกศิษย์ที่เก่งที่สุดของช้านนนนนน แต่ดันไม่มี\r\n.\r\nขอยกพารากราฟนี้ให้กับความดีงามของเจนลอวณ์ทั้งพารากราฟ ขอบอกเลยว่า นางเป็นนักแสดงพันหน้าและแสดงได้หลายอารมณ์แบบว่าเก่งมาก ด้วยโครงสร้างบทและการเดินเรื่องที่แสนจะน่าเบื่อ แต่เจนลอว์สามารถทำให้คนดูได้รู้สึกว่าหนังมันมีพลังอะไรอยู่ (ซึ่งดูจนจบมันก็ไม่มีอะไร) เจนลอว์ สวยมากกกกกกกกกสวยอวบอิ่ม ยั่วยวน ยั่วเย เธอดูสับสนระหว่างการเป็นนักฆ่าหรือผู้หญิงที่มีวิญญาณ ซึ่งแน่นอนว่าตามบทคงต้องการให้โดมินิกาออกมาเป็นแบบนี้แหละ และที่สำคัญเรื่องนี้เธอพูดภาษาอังกฤษสำเนียงรัสเซีย ส่วนตัวไม่รู้ว่ะว่าเป้ะไหม แต่ขอเดาว่าเป้ะไว้ก่อน เพราะเรารักเจนลอว์ \r\n.\r\nอีกคนไม่พูดถึงไม่ได้ Joel Edgerton นี่พูดเลย เป็นดาราฮอลลีวู้ดอีกคนที่โคตรมีเสน่ห์และหล่อมาก แถมแสดงหนังเก่งอีกตะหาก กำกับหนังเองก็ได้ \r\n\r\nนอกจากนี้เราจะยังได้เห็นตัวประกอบเป็นหนุ่มรัสเซียอีกคนสองคนที่หน้าตาจิ่มลิ้มตัวขาวซีดเหมือนผีดิบนุ่งน้อยห่มน้อยมาโชว์กระบองแบบผ่านๆก็ยังดีวะ\r\n\r\nเอาจริงๆนะ Red Sparrow มันก็ยังไม่ได้หลุดลงไปเป็นหนังแย่อะไรมากนะ แต่หนังมันไม่สนุกเลยนี่สิ เอาจริงๆไปหาสปอยล์ก่อนเข้าไปดูนิดนึงก็ดีนะ น่าจะดูสนุกขึ้น เพราะหนังแนวนี้มันพลิกไปพลิกมา แต่เรื่องนี้ไม่พลิกมาก ใครเป็นแฟนเจนลอว์ก็ไปดูได้ รับรองไม่น่าผิดหวังนะ 6/10 แหละ ให้เท่านี้แหละผมว่าแฟร์', '10 มกราคม 2560'),
(3, 2, 1, 65, 'ฟีลลิ่งการผจญภัยมาเต็ม แต่การไขปริศนาไม่ออกมาเลย อลิเซีย วิกันเดอร์เหมาะสมกับบทลาร่า ครอฟต์เวอร์ชั่นนี้มาก', 'Tomb Raider (2018) เข้าฉายแล้ววันนี้\r\n\r\nชอบฟีลลิ่งการผจญภัยล่าขุมทรัพย์ของหนังนะ ได้อารมณ์เหมือนเวลาเล่นเกมแนวนี้ เช่นเกม Tomb Raider เอง หรือว่าเกม Uncharted 4 ประมาณนั้น แล้วอลิเซีย วิกันเดอร์ ก็เหมาะสมลงตัวกับบทลาร่า ครอฟต์เวอร์ชั่นนี้มาก อย่างน้อยการเทรนนิ่งเพิ่มกล้ามเนื้อเพื่อให้สมบทบาทมันก็ช่วยให้ฉากสตั๊นท์ต่าง ๆ ที่เธอเล่นเองดูน่าเชื่อถือขึ้นเยอะ แต่หนังก็มีปัญหาในส่วนอื่น ๆ อยู่ไม่น้อยเหมือนกัน ทั้งฟีลลิ่งการไขปริศนาที่แทบไม่ปรากฎออกมาเลย มันดูเจอสุสานง๊ายง่าย เข้าก็ไม่ได้ยาก แต่ชอบกับดักข้างในสุสานนะ เชย ๆ แต่ออกมาดี อีกอย่างที่หนังทำได้แย่คือส่วนการเล่าเรื่องและการสร้างคาแรคเตอร์ หลายครั้งหนังชอบทำอะไรเด๋อ ๆ ให้มันยุ่งยากมากขึ้นโดยใช่เหตุ แล้วตัวละครเองก็ดูเก่งแบบไม่มีที่มาที่ไปสักเท่าไร ฉากเปิดเรื่องยังชกมวยแพ้อยู่เลยแต่พอขึ้นเกาะปุ๊บเหมือนอยู่ดี ๆ เลเวลอัพ ตัวประกอบฝั่งตัวร้ายนี่ก็อารมณ์เล่นเกมโหมด beginner ยิงก็ไม่แม่น สู้ก็ไม่เก่ง มิติตัวละครก็แบนกันหมด รวม ๆ แล้วถ้าดูเอาสนุกแบบหนังผจญภัยไม่ต้องคาดหวังเยอะก็พอได้อยู่\r\n.\r\nหนังเล่าเรื่องของ \'ลาร่า ครอฟต์\' (Alicia Vikander) ที่ออกตามไขปริศนาสุดท้ายเกี่ยวกับสุสานฮิเดโกะที่พ่อผู้หายสาบสูญของเธอทิ้งเอาไว้ ซึ่งการเดินทางครั้งนี้ทำให้เธอต้องเผชิญหน้ากับ \'โวเกิล\' (Walton Goggins) ที่เฝ้าตามหาทางเข้าสุสานมานานถึง 7 ปี\r\n.\r\nเราว่าสิ่งที่จะทำให้หนังแนวล่าขุมทรัพย์ออกมาสนุกมันต้องสมดุลกันระหว่าง ผจญภัยและไขปริศนา พูดง่าย ๆ ว่าต้องใช้ทักษะทางกายภาพและต้องให้สมองทำงานด้วย แต่ปัญหาของ Tomb Raider คือด้านไขปริศนามันไม่ออกมาเลย ตั้งแต่ได้ลายแทงจากพ่อมาหนังก็พาไปเจอสุสานแบบไม่ยากเย็นสักเท่าไร เปิดสุสานกันง่ายเป็นปอกกล้วยเลยทีเดียว เทียบกับเวลาเราเล่นเกมแนวนี้ที่ต้องไปนู่นนี่เพื่อหาเบาะแสมาอย่างยากลำบากแล้วดูเหมือนหนังจะสอบตกด้านเสน่ห์ของการไขปริศนาไปโดยปริยาย ขณะเดียวกันหนังก็มาชดเชยด้วยการผจญภัยที่ดูตื่นเต้น กับดักต่าง ๆ ในสุสานรวมถึงการเอาตัวรอดบนเกาะอาจจะเป็นอะไรที่แทบไม่มีความสดใหม่เลย แต่หนังทำสิ่งเชย ๆ เหล่านี้ให้ออกมาสนุกใช้ได้อยู่ ส่วนฉากแอ็คชั่นติดอย่างเดียวคือหนังน่าจะเปิดโหมดเลเวลสัก normal ก็ยังดี นี่เหมือน amature ซึ่งมันไม่ค่อยสนุกเท่าไรเวลายิงปืนหรือต่อสู้กัน แถมยังชอบลีลามากความเหมือนรอเสียท่าให้นางเอกกันด้วย\r\n.\r\nโดยรวมแล้วถ้าไม่คิดมากก็พอใช้ได้อยู่ เน้นจุดขายฟีลลิ่งผจญภัยแต่ไม่ได้ฟีลไขปริศนาสักเท่าไร แล้วก็อย่าคาดหวังดราม่าหรือการเล่าเรื่องเพราะหนังไม่ตอบโจทย์นั้นแน่นอน ดูเป็นหนังผจญภัยเพลิน ๆ ได้อย่างเดียว \r\n\r\nป.ล. เล่นตัว demo 40 นาทีของ Rise of the Tomb Raider ใน PS4 แล้วชอบมาก รอเกมเต็มลดราคาเมื่อไรจะจัดแน่นอน (ชอบกว่า Uncharted 4 อีก)\r\n\r\nDirector: Roar Uthaug (ผู้กำกับ The Wave)\r\nstory: Evan Daugherty, Geneva Robertson-Dworet\r\nscreenplay: Geneva Robertson-Dworet, Alastair Siddons\r\n\r\nGenre: action, adventure\r\n6.5/10', '5 มกราคม 2560'),
(4, 2, 2, 75, 'หนังสายลับต้องสู้กันด้วยไหวพริบจิตวิทยาแบบนี้สิถึงจะสนุก เนื้อหาจัดเต็มความรุนแรง ดิบ โหด ถึงดูน่าเชื่อว่าเป็นโลกสายลับ', 'Red Sparrow (2018) เข้าฉายแล้ววันนี้\r\n\r\nค่อยสมกับเป็นหนังสายลับสงครามเย็นหน่อย รู้สึกโอเคมาก ๆ ที่ทำเป็นหนังเรท 15+ เพราะเนื้อหาและความรุนแรงมัน\r\nเรียกร้องว่าต้องดิบและโหดถึงเบอร์นั้นถึงจะดูจริงจังสมจริงให้เชื่อได้ว่าเป็นหนังสายลับ ชอบที่มันไม่ได้บ้าแอ็คชั่น จะใส่\r\nเข้ามาก็ต่อเมื่อจำเป็นเท่านั้น หนังสายลับยุคสงครามเย็นมันต้องสู้ด้วยไหวพริบจิตวิทยาแบบนี้ถึงจะสนุก ไม่แปลกใจเลย\r\nที่นิยายเขียนโดยอดีตเจ้าหน้าที่ CIA ส่วนที่ชอบที่สุดของหนังคือช่วงฝึกสแปร์โรว์ เสียดายว่ามีน้อยไปหน่อย เป็นช่วงสอน\r\nสายลับให้หาจุดอ่อนของมนุษย์ที่ทั้งกดดันและวัดปัญญากันสุดฤทธิ์ แต่พอปล่อยสายลับอย่างนางเอกลงปฏิบัติการณ์\r\nแล้วนางดูฉลาดแผนสูงเกิน ดูเก่งมาก่อนฝึกสายลับอีก\r\n.\r\n\'โดมินิก้า\' (Jennifer Lawrence) เป็นนักบัลเล่ต์ที่ประสบอุบัติเหตุระหว่างการแสดง ซึ่งเมื่อเธอหมดประโยชน์กับรัฐแล้วก็\r\nจะไม่สามารถส่งแม่ไปรักษากับหมอดี ๆ รวมถึงอาจจะไม่ได้อยู่คอนโดที่เดิม จึงทำให้เธอตอบรับงานจากอาที่ทำงานอยู่\r\nหน่วยข่าวกรอง ในการใช้มารยาหญิงเข้าไปตีสนิทกับนักการเมือง ซึ่งหลังจากนั้นเธอก็จำเป็นต้องเข้าโปรแกรมฝึกสายลับ \r\nพร้อมได้รับมอบหมายงานแรกคือการเข้าไปทำให้ \'แนช\' (Joel Edgerton) สายลับอเมริกันไว้วางใจเธอให้ได้\r\n.\r\nตอนแรกได้ยินกระแสฉากโป๊เปลือยจนนึกว่าหนังจะเต็มไปด้วยเรื่องอย่างว่าซะแล้ว แต่เอาเข้าจริงมันแทบไม่ได้มีฉากพวก\r\nนั้นเลย หนังใส่เรื่อง sex เข้ามาเพียงต้องการสื่อให้เห็นถึงความต้องการของมนุษย์และวิธีเอาชนะเท่านั้น ซึ่งมันก็ไปเด่น\r\nในแง่จิตวิทยามากกว่าจะหมกมุ่นเรื่องเพศแบบที่โรงเรียนสายลับถูกนิยามเป็นสถานที่สอนโสเภณี ช่วงตอนฝึกเลยดูฉลาด \r\nดูกดดันให้คน ๆ หนึ่งต้องทำอะไรเกินตัวด้วยข้ออ้างเรื่องรับใช้รัฐ ซึ่งเราว่าในใจนางเอกก็ต้องตั้งคำถามอยู่ไม่น้อยจึงอาจ\r\nจะมีความแสวงหาโลกเสรีแบบฝั่งอเมริกันอยู่ด้วย การเซ็ตให้ตัวนางเอกไม่ค่อยแสดงออกอะไรเท่าไรเลยดูเป็นสิ่งที่ดี\r\nเหมือนกัน เพราะเรารู้สึกว่านางคิดแผนใหญ่แน่ ๆ แต่ไม่รู้ว่าจะใหญ่ขนาดไหน ตัวแปรสำคัญคือเธอมีแม่อยู่ในรัสเซีย\r\nเหมือนเป็นตัวประกันของฝั่งหน่วยข่าวกรองด้วย การจะหนีไปเฉย ๆ จึงไม่ใช่เรื่องที่จะเกิดขึ้นง่าย ๆ อย่างแน่นอน ซึ่งพอ\r\nตัวละครนางเอกสามารถทำอะไรได้เยอะแบบในหนังจึงยิ่งทำให้เห็นพลานุภาพของสายลับ(แบบไม่ต้องแอ็คชั่น)ว่า\r\nสามารถเดินเกมได้เฉียบแค่ไหน\r\n\r\nDirector: Francis Lawrence\r\nnovel: Jason Matthews\r\nscreenplay: Justin Haythe\r\n\r\nGenre: mystery, thriller\r\n7.5/10', '20 มกราคม 2560');

